import React from 'react';
import classes from './App.Module.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav className={classes.Topbar} >
          <img src="" alt ="Amazon logo" />

        </nav>

      </header>
    </div>
  );
}

export default App;
